(38, 32, 6, 'Noche de Encanto', '<p style="margin: 0cm 0cm 0.0001pt; line-height: 19.5pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline;"><span style="font-size:10.5pt;font-family:"Arial",sans-serif;\r\ncolor:#818181">La naturaleza es la protagonista principal del Altiplánico Sur.\r\nEl hotel está enclavado en la ladera de una colina natural que llega a\r\norillas del mar del Seno de Última Esperanza. Los techos están cubiertos\r\nde pasto y los muros recubiertos de turba vegetal, dándole una apariencia\r\norgánica. Todas las áreas del hotel, incluyendo las habitaciones, tienen vistas\r\npreciosas al Seno de Última Esperanza y al Glaciar Balmaceda.<o:p></o:p></span></p>\r\n\r\n<p style="margin: 0cm 0cm 0.0001pt; line-height: 19.5pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline;"><b><span style="font-size:10.5pt;font-family:"Arial",sans-serif;color:#818181"><o:p> </o:p></span></b></p>\r\n\r\n<p style="margin: 0cm 0cm 0.0001pt; line-height: 19.5pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline;"><b><span style="font-size:10.5pt;font-family:"Arial",sans-serif;color:#818181">¿Qué\r\nIncluye?<br>\r\n</span></b><span style="font-size:10.5pt;font-family:"Arial",sans-serif;\r\ncolor:#818181">· Noche en habitación Superior<br>\r\n· Desayuno Buffet<br>\r\n· Vista al Seno Última Esperanza desde la habitación y baño privado.<br>\r\n<!--[if !supportLineBreakNewLine]--><br>\r\n<!--[endif]--><o:p></o:p></span></p>\r\n\r\n<p style="margin: 0cm 0cm 0.0001pt; line-