(61, 54, 6, 'Ven a Descubrir el Desierto', '                                                                                                               <p style="background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; border: 0px; margin-bottom: 0px; padding: 0px; vertical-align: baseline; outline: 0px; color: rgb(133, 133, 133); font-family: Raleway, sans-serif; font-size: 14px; line-height: 25px;">Park Hotel Calama cuenta con una amplia gama de servicios, los que están basados en una preocupación constante por los detalles y la calidad propia de los Hoteles Park. Este es uno de los pocos sitios del mundo en donde converge la riqueza arqueológica y la abundancia de atractivos naturales. Cercano al Salar  de Atacama y a San Pedro de Atacama, el Hotel te invita a disfrutar de esta ubicación privilegiada del país junto a los servicios que ofrece.</p><p style="background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; border: 0px; margin-bottom: 0px; padding: 0px; vertical-align: baseline; outline: 0px; color: rgb(133, 133, 133); font-family: Raleway, sans-serif; font-size: 14px; line-height: 25px;">¿ Qué Incluye ?</p><ul style="background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; border: 0px; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; vertical-align: baseline; outline: 0px; list-style-position: inside; color: rgb(133, 133, 133); font-family: Montserrat, sans-serif; font-size: 14px;"><li style="background: 0px 0px; border: 0px; margin: 0px; padding: 0px; vertical-align: baseline; outline: 0px;">Una noche de alojamiento en habitación Suite</li><li style="background: 0px 0px; border: 0px; margin: 0px; padding: 0px; vertical-align: baseline; outline: 0px;">Desayuno Buffet</li></ul><p style="background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; border: 0px; margin-bottom: 0px; padding: 0px; vertical-align: baseline; outline: 0px; color: rgb(133, 133, 133); font-family: Raleway, sans-serif; font-size: 14px; line-height: 25px;">(Restricciones: Reservar con mínimo 72 horas de anticipación. Reserva válida sólo para fines de semana. Sujeto a disponibilidad. Cancelaciones o modificaciones de reserva con anticipación, de lo contrario el Ticket se dará por utilizado.)</p>                                     \r\n                                                                                                                                                    ', ' Alcalde Jose Lira 1392, Calama,  Región de Antofagasta', 2201, ' (55) 271 5800', 'reserva@parkcalama.cl', 73950, '201610061047067705-hotel-park-calama.jpg', '1', NULL);
