(72, 58, 1, 'Dia de Spa', '<p style="background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; border: 0px; margin-bottom: 0px; padding: 0px; vertical-align: baseline; outline: 0px; color: rgb(133, 133, 133); font-family: Raleway, sans-serif; font-size: 14px; line-height: 25px;">Ya es tiempo de que te tomes un tiempo para tí… ¡ En Tina Spa podrás encontrar a las mejores profesionales para hacer ese día único y exclusivamente para tí !</p><p style="background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; border: 0px; margin-bottom: 0px; padding: 0px; vertical-align: baseline; outline: 0px; color: rgb(133, 133, 133); font-family: Raleway, sans-serif; font-size: 14px; line-height: 25px;"><strong style="background: 0px 0px; border: 0px; margin: 0px; padding: 0px; vertical-align: baseline; outline: 0px;">¿ Qué Incluye ?</strong></p><p style="background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; border: 0px; margin-bottom: 0px; padding: 0px; vertical-align: baseline; outline: 0px; color: rgb(133, 133, 133); font-family: Raleway, sans-serif; font-size: 14px; line-height: 25px;"><br></p><ul style="background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; border: 0px; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; vertical-align: baseline; outline: 0px; list-style-position: inside; color: rgb(133, 133, 133); font-family: Montserrat, sans-serif; font-size: 14px;"><li style="background: 0px 0px; border: