(105, 76, 4, 'Discover Scuba Diving', '<p style="margin: 0cm 0cm 0.0001pt; line-height: 19.5pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline;"><span style="font-size:10.5pt;font-family:"Arial",sans-serif;\r\ncolor:#818181">Austral Divers te invita a disfrutar de nuestros inolvidables\r\nprogramas de buceo junto a nuestro equipo de profesionales (instructores\r\nde primer nivel), con más de 10 años de experiencia en el rubro del buceo.\r\nVen a conocer el fondo marino de Quintay.<o:p></o:p></span></p>\r\n\r\n<p style="margin: 0cm 0cm 0.0001pt; line-height: 19.5pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline;"><strong><span style="font-size:10.5pt;font-family:\r\n"Arial",sans-serif;color:#818181;border:none windowtext 1.0pt;mso-border-alt:\r\nnone windowtext 0cm;padding:0cm">¿ Qué Incluye ?</span></strong><span style="font-size:10.5pt;font-family:"Arial",sans-serif;color:#818181"><o:p></o:p></span></p>\r\n\r\n<p style="margin: 0cm 0cm 0.0001pt; line-height: 19.5pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline;"><b><span style="font-size:10.5pt;font-family:"Arial",sans-serif;\r\ncolor:#818181;border:none windowtext 1.0pt;mso-border-alt:none windowtext 0cm;\r\npadding:0cm"><br>\r\n</span></b><span style="font-size:10.5pt;font-family:"Arial",sans-serif;\r\ncolor:#818181">· Válido para una persona.<br>\r\n· Entretenido programa; después de una clase básica de buceo, te sumergirás\r\njunto a la  supervisión de un profesional\r\nPADI hasta una profundidad de 10 mts., experimentando la sensación de respirar\r\nbajo el agua y conociendo la espectacular flora y fauna marina de Quintay.<br>\r\n· Todo el equipamiento necesario y el uso de nuestras instalaciones.<br>\r\n<em><span style="border: 1pt none windowtext; padding: 0cm;">(Restricción: Edad mínima\r\n10 años. Aprobar cuestionario médico. No incluye traslado. Se debe reservar con\r\nanticipación.)</span></em><o:p></o:p></span></p>\r\n\r\n<p style="margin: 0cm 0cm 0.0001pt; line-height: 19.5pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline;"><strong><span style="font-size:10.5pt;font-family:\r\n"Arial",sans-serif;color:#818181;border:none windowtext 1.0pt;mso-border-alt:\r\nnone windowtext 0cm;padding:0cm"><o:p> </o:p></span></strong></p>                                     \r\n                                     ', 'Caleta Quintay – Región de Valparaíso.', 0, '(2) 2 492 79 75 / +569 8 723 85 58 / +56 9 9 885 50 99', 'contacto@australdivers.cl', 25210, '20161017081558Austral Divers.jpg', '1', NULL),
