(114, 82, 4, 'Ven a Conocer las Catedrales de Marmol', '<p style="margin: 0cm 0cm 0.0001pt; line-height: 19.5pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline;"><span style="font-size:10.5pt;font-family:"Arial",sans-serif;\r\ncolor:#818181">Vive una experiencia extrema en la Patagonia. Te invitamos a ser\r\nparte de un recorrido por las Capillas de mármol, santuario de la\r\nnaturaleza ubicado en el Lago General Carrera. Disfruta de este momento en\r\nmanos de un instructor experto que te guiará en un fascinante viaje de\r\nexploración.<o:p></o:p></span></p>\r\n\r\n<p style="margin: 0cm 0cm 0.0001pt; line-height: 19.5pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline;"><span style="font-size:10.5pt;font-family:"Arial",sans-serif;\r\ncolor:#818181"><o:p> </o:p></span></p>\r\n\r\n<p style="margin: 0cm 0cm 0.0001pt; line-height: 19.5pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline;"><strong><span style="font-size:10.5pt;font-family:\r\n"Arial",sans-serif;color:#818181;border:none windowtext 1.0pt;mso-border-alt:\r\nnone windowtext 0cm;padding:0cm">¿ Qué Incluye ?</span></strong><span style="font-size:10.5pt;font-family:"Arial",sans-serif;color:#818181"><o:p></o:p></span></p>\r\n\r\n<p style="margin: 0cm 0cm 0.0001pt; line-height: 19.5pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline;"><span style="font-size:10.5pt;font-family:"Arial",sans-serif;\r\ncolor:#818181">· Válido para una persona<br>\r\n· Kayak<br>\r\n· Equipo de seguridad<br>\r\n· Guía<br>\r\n· Bebida Isotónica<br>\r\n<em><span style="border: 1pt none windowtext; padding: 0cm;">(Restricción: Sujeto a disponibilidad.\r\nSe suspenden las actividades por mal clima y se reprograman las\r\nfechas. No incluye traslados.)</span></em><o:p></o:p></span></p>                                     \r\n                                     ', 'Circunvalación Oriente Poniente 1522 Villa el Divisadero, Coyhaique', 0, '+569 8 655 5536 / +569 8 655 5586', 'kakak.explora@gmail.com', 25210, '20161017113732Travesía por un Lago.jpg', '1', NULL),
(115, 86, 4, 'Parapente por el Desierto', '<p class="MsoNormal" style="margin-bottom: 0.0001pt; line-height: 19.5pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline;"><span style="font-size:10.5pt;\r\nfont-family:"Arial",sans-serif;mso-fareast-font-family:"Times New Roman";\r\ncolor:#818181;mso-fareast-language:ES-CL">Súmate a la experiencia de volar por\r\nlos aires de Iquique con profesionales de más de 14 años de experiencia.\r\nDeja la rutina, escápate, libérate del stress y sé parte de este momento\r\núnico. Si quieres adrenalina en tu vida, elige Oasis Fly y graba en\r\ntu memoria cada segundo de este vuelo.<o:p></o:p></span></p>\r\n\r\n<p class="MsoNormal" style="margin-bottom: 0.0001pt; line-height: 19.5pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline;"><span style="font-size:10.5pt;\r\nfont-family:"Arial",sans-serif;mso-fareast-font-family:"Times New Roman";\r\ncolor:#818181;mso-fareast-language:ES-CL"><o:p> </o:p></span></p>\r\n\r\n<p class="MsoNormal" style="margin-bottom: 0.0001pt; line-height: 19.5pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline;"><b><span style="font-size:\r\n10.5pt;font-family:"Arial",sans-serif;mso-fareast-font-family:"Times New Roman";\r\ncolor:#818181;border:none windowtext 1.0pt;mso-border-alt:none windowtext 0cm;\r\npadding:0cm;mso-fareast-language:ES-CL">¿ Qué Incluye ?<o:p></o:p></span></b></p>\r\n\r\n<p class="MsoNormal" style="margin-bottom: 0.0001pt; line-height: 19.5pt; background-image: initial; backgroun