(124, 92, 4, 'Vuelo en Parapente', '<p style="margin: 0cm 0cm 0.0001pt; line-height: 19.5pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline;"><span style="font-size:10.5pt;font-family:"Arial",sans-serif;\r\ncolor:#818181">Dedicados al placer de la aventura aérea. Disfruta como las aves\r\ncon nuestra experiencia; cuya misión es crear conciencia del vuelo libre.\r\nVive la sensación de volar junto a profesionales del más alto nivel. Aprovecha\r\nla oportunidad de vivir una tremenda experiencia y ver Santiago desde los\r\naires.<o:p></o:p></span></p>\r\n\r\n<p style="margin: 0cm 0cm 0.0001pt; line-height: 19.5pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline;"><b><span style="font-size:10.5pt;font-family:"Arial",sans-serif;color:#818181"><o:p> </o:p></span></b></p>\r\n\r\n<p style="margin: 0cm 0cm 0.0001pt; line-height: 19.5pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline;"><b><span style="font-size:10.5pt;font-family:"Arial",sans-serif;color:#818181">¿ Qué\r\nIncluye ?<o:p></o:p></span></b></p>\r\n\r\n<p style="margin: 0cm 0cm 0.0001pt 18pt; text-indent: -18pt; line-height: 19.5pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline;"><!--[if !supportLists]--><span style="font-size:10.0pt;mso-bidi-font-size:10.5pt;font-family:Symbol;\r\nmso-fareast-font-family:Symbol;mso-bidi-font-family:Symbol;color:#818181">·<span style="font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: "Times New Roman";">        \r\n</span></span><!--[endif]--><span style="font-size:10.5pt;font-family:"Arial",sans-serif;\r\ncolor:#818181">Para 1 persona.<b><o:p></o:p></b></span></p>\r\n\r\n<p style="margin: 0cm 0cm 0.0001pt 18pt; text-indent: -18pt; line-height: 19.5pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline;"><!--[if !supportLists]--><span style="font-size:10.0pt;mso-bidi-font-size:10.5pt;font-family:Symbol;\r\nmso-fareast-font-family:Symbol;mso-bidi-font-family:Symbol;color:#818181">·<span style="font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: "Times New Roman";">        \r\n</span></span><!--[endif]--><span style="font-size:10.5pt;font-family:"Arial",sans-serif;\r\ncolor:#818181">Introducción básica sobre el vuelo.<b><o:p></o:p></b></span></p>\r\n\r\n<p style="margin: 0cm 0cm 0.0001pt 18pt; text-indent: -18pt; line-height: 19.5pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline;"><!--[if !supportLists]--><span style="font-size:10.0pt;mso-bidi-font-size:10.5pt;font-family:Symbol;\r\nmso-fareast-font-family:Symbol;mso-bidi-font-family:Symbol;color:#818181">·<span style="font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: "Times New Roman";">        \r\n</span></span><!--[endif]--><span style="font-size:10.5pt;font-family:"Arial",sans-serif;\r\ncolor:#818181">Vuelo con instructor (mínimo 15 minutos de vuelo), donde se\r\npodrá apreciar Santiago desde los aires y vivir experiencias desde las alturas.<b><o:p></o:p></b></span></p>\r\n\r\n<p style="margin: 0cm 0cm 0.0001pt 18pt; text-indent: -18pt; line-height: 19.5pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline;"><!--[if !supportLists]--><em><span style="font-size:10.0pt;mso-bidi-font-size:10.5pt;font-family:Symbol;\r\nmso-fareast-font-family:Symbol;mso-bidi-font-family:Symbol;color:#818181;\r\nfont-style:normal">·<span style="font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: "Times New Roman";">        \r\n</span></span></em><!--[endif]--><span style="font-size:10.5pt;font-family:\r\n"Arial",sans-serif;color:#818181">Sí quieres fotos o vídeos tienes que\r\ncoordinar con el instructor.<br>\r\n<!--[if !supportLineBreakNewLine]--><br>\r\n<!--[endif]--><em><b><span style="font-style: normal;"><o:p></o:p></span></b></em></span></p>\r\n\r\n<p class="MsoNormal" style="margin-bottom: 0.0001pt; line-height: 19.5pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline;"><em><span style="font-size:\r\n10.5pt;font-family:"Arial",sans-serif;color:#818181;border:none windowtext 1.0pt;\r\nmso-border-alt:none windowtext 0cm;padding:0cm">(Restricción: Sujeto a\r\ncondiciones climáticas y a disponibilidad. Reservar con 48 horas de\r\nanticipación. Menores de edad deben ir acompañados por sus padres.)</span></em><span style="font-size:10.5pt;font-family:"Arial",sans-serif;color:#818181"><o:p></o:p></span></p>\r\n\r\n<p style="margin: 0cm 0cm 0.0001pt; line-height: 19.5pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline;"><span style="font-size:10.5pt;font-family:"Arial",sans-serif;\r\ncolor:#818181"> <o:p></o:p></span></p>\r\n\r\n<strong><span style="font-size:10.5pt;line-height:115%;font-family:"Arial",sans-serif;\r\nmso-fareast-font-family:Calibri;mso-fareast-theme-font:minor-latin;color:#818181;\r\nborder:none windowtext 1.0pt;mso-border-alt:none windowtext 0cm;padding:0cm;\r\nmso-ansi-language:ES-CL;mso-fareast-language:EN-US;mso-bidi-language:AR-SA">Horario: </span></strong><span style="font-size:10.5pt;line-height:115%;font-family:"Arial",sans-serif;\r\nmso-fareast-font-family:Calibri;mso-fareast-theme-font:minor-latin;color:#818181;\r\nmso-ansi-language:ES-CL;mso-fareast-language:EN-US;mso-bidi-language:AR-SA">De\r\nlunes a domingo. En verano de 13:00 a 21:00 hrs y en invierno de 13:00 a\r\n19:00 hrs.<br>\r\n<!--[if !supportLineBreakNewLine]--><br>\r\n<!--[endif]--></span>                                     \r\n                                     ', 'Pedro de Fontova, (Cerro el Carmen) Huechuraba', 13302, '+569 9 280 1614', 'info@vueloenparapente.cl', 25210, '20161017133402Vuelo en Parapente.jpg', '1', NULL),
(125, 75, 5, 'Pescao con Mosca en Santiago', '                                     <p style="margin: 0cm 0cm 0.0001pt; line-height: 19.5pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline;"><span style="font-size:10.5pt;font-family:" arial",sans-serif;="" color:#818181"="">Descubre y aprende el arte de la pesca con Mosca. Vive la magia\r\ndel sur y desconéctate a pasos de tu casa. Tenemos lagunas pobladas con\r\ntruchas, carpas y pejerreyes. Practicamos sólo Catch & Release\r\n(captura y devolución). Podrás aprender a lanzar y pescar. Vive la\r\nexperiencia de un deporte al aire libre, conectado con la naturaleza; la\r\nsensación única y relajante de capturar y liberar un pez.<o:p></o:p></span></p>\r\n\r\n<p style="margin: 0cm 0cm 0.0001pt; line-height: 19.5pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline;"><span style="font-size:10.5pt;font-family:" arial",sans-serif;="" color:#818181"=""><o:p> </o:p></span></p>\r\n\r\n<p style="margin: 0cm 0cm 0.0001pt; line-height: 19.5pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline;"><b><span style="font-size:10.5pt;font-family:" arial",sans-serif;color:#818181"="">¿ Qué\r\nIncluye ?<o:p></o:p></span></b></p>\r\n\r\n<p style="margin: 0cm 0cm 0.0001pt; line-height: 19.5pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline;"><span style="font-size:10.5pt;font-family:" arial",sans-serif;="" color:#818181"="">· Clase de Lanzamiento de 2 horas<br>\r\n· En Parque Padre Hurtado o Parque Bicentenario<br>\r\n· Equipo Completo<br>\r\n· Moscas<o:p></o:p></span></p>\r\n\r\n<p style="margin: 0cm 0cm 0.0001pt; line-height: 19.5pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline;"><span style="font-size:10.5pt;font-family:" arial",sans-serif;="" color:#818181"=""><br>\r\n<em><span style="border: 1pt none windowtext; padding: 0cm;">(Restricción: No incluye\r\nla entrada al Parque Padre Hurtado (Peatón $500, Auto $3.000). Reservar\r\ncon 48 horas de anticipación. Sujeto a disponibilidad.)</span></em><o:p></o:p></span></p>\r\n\r\n<p style="margin: 0cm 0cm 0.0001pt; line-height: 19.5pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline;"><span style="font-size:10.5pt;font-family:" arial",sans-serif;="" color:#818181"=""> <o:p></o:p></span></p>                                     \r\n                                                                          ', 'Francisco Bilbao 8501, La Reina. Santiago – Región Metropolitana / Av. BICENTENARIO 3800, Vitacura. Santiago – Región Metropolitana.', 13113, '+569 9 432 6375 / +56) 7 898 7934', 'info@fishpark.cl', 40336, '20161017135526Fish Park 1.jpg', '1', NULL),
(126, 76, 5, 'Dia de Buceo', '<p style="margin: 0cm 0cm 0.0001pt; line-height: 19.5pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline;"><span style="font-size:10.5pt;font-family:"Arial",sans-serif;\r\ncolor:#818181">Austral Divers te invita a disfrutar de nuestros inolvidables\r\nprogramas de buceo junto a nuestro equipo de profesionales (instructores\r\nde primer nivel), con más de 10 años de experiencia en el rubro del buceo.\r\nVen a conocer el fondo marino de Quintay con nosotros.<o:p></o:p></span></p>\r\n\r\n<p style="margin: 0cm 0cm 0.0001pt; line-height: 19.5pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline;"><span style="font-size:10.5pt;font-family:"Arial",sans-serif;\r\ncolor:#818181"><o:p> </o:p></span></p>\r\n\r\n<p style="margin: 0cm 0cm 0.0001pt; line-height: 19.5pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline;"><span style="font-size:10.5pt;font-family:"Arial",sans-serif;\r\ncolor:#818181">¿ Qué Incluye ?<o:p></o:p></span></p>\r\n\r\n<p style="margin: 0cm 0cm 0.0001pt; line-height: 19.5pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline;"><span style="font-size:10.5pt;font-family:"Arial",sans-serif;\r\ncolor:#818181">· Dos inmersiones en el día junto a la supervisión de un\r\nprofesional PADI. Conocerás el fondo submarino y los distintos naufragios\r\nballeneros, hundidos en el lugar de hace más de 60 años.<br>\r\n· Todo el equipamiento necesario y uso de instalaciones.<br>\r\n<!--[if !supportLineBreakNewLine]--><br>\r\n<!--[endif]--><em><span style="border: 1pt none windowtext; padding: 0cm;"><o:p></o:p></span></em></span></p>\r\n\r\n<p style="margin: 0cm 0cm 0.0001pt; line-height: 19.5pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline;"><em><span style="font-size:10.5pt;font-family:"Arial",sans-serif;\r\ncolor:#818181;border:none windowtext 1.0pt;mso-border-alt:none windowtext 0cm;\r\npadding:0cm">(Restricción: Edad mínima 10 años. Aprobar cuestionario\r\nmédico. No incluye traslado. Reservar con anticipación.)</span></em><span style="font-size:10.5pt;font-family:"Arial",sans-serif;color:#818181"><o:p></o:p></span></p>                                     \r\n                                     ', 'Caleta Quintay', 0, '(2) 2 492 7975 / +569 8 723 8558 / +569 9 885 5099', 'contacto@australdivers.cl', 37815, '20161017135831AD.jpg', '1', NULL);
