(127, 77, 5, 'Clase de Cocina Interactiva', '<p style="margin: 0cm 0cm 0.0001pt; line-height: 19.5pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline;"><span style="font-size:10.5pt;font-family:"Arial",sans-serif;\r\ncolor:#818181">Somos una empresa que desde el año 1999 ha enfrentado como un\r\ndesafío innovar en el exigente mundo de la gastronomía. Nos motiva la\r\nsimpleza en los sabores y en las preparaciones de las comidas, junto a la\r\ncalidad y nobleza de los productos. Con una atención personalizada y\r\nespecializada sin perder detalle en la presentación y en el servicio.<o:p></o:p></span></p>\r\n\r\n<p style="margin: 0cm 0cm 0.0001pt; line-height: 19.5pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline;"><span style="font-size:10.5pt;font-family:"Arial",sans-serif;\r\ncolor:#818181"><o:p> </o:p></span></p>\r\n\r\n<p style="margin: 0cm 0cm 0.0001pt; line-height: 19.5pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline;"><span style="font-size:10.5pt;font-family:"Arial",sans-serif;\r\ncolor:#818181">¿ Qué Incluye ?<o:p></o:p></span></p>\r\n\r\n<p style="margin: 0cm 0cm 0.0001pt; line-height: 19.5pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline;"><span style="font-size:10.5pt;font-family:"Arial",sans-serif;\r\ncolor:#818181">· Una clase de cocina<br>\r\n· Los alimentos para la clase<br>\r\n· La degustación de lo preparado y varios consejos para optimizar la\r\npreparación de la comida<br>\r\ndiaria, con ideas para la presentación y montaje de los platos.<br>\r\n· Un tríptico con la receta y el desarrollo de esta.<br>\r\n· La clase se realiza en el domicilio y en lo posible utilizando los\r\nimplementos con los que se cuenta en casa.<br>\r\n<!--[if !supportLineBreakNewLine]--><br>\r\n<!--[endif]--><em><span style="border: 1pt none windowtext; padding: 0cm;"><o:p></o:p></span></em></span></p>\r\n\r\n<p style="margin: 0cm 0cm 0.0001pt; line-height: 19.5pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline;"><em><span style="font-size:10.5pt;font-family:"Arial",sans-serif;\r\ncolor:#818181;border:none windowtext 1.0pt;mso-border-alt:none windowtext 0cm;\r\npadding:0cm">(Restricción: No incluye vinos ni aperitivos con alcohol. La\r\nreserva y definición de menú debe ser con</span></em><span style="font-size:\r\n10.5pt;font-family:"Arial",sans-serif;color:#818181"> <em><span style="border: 1pt none windowtext; padding: 0cm;">una semana de anticipación.)</span></em><o:p></o:p></span></p>                                     \r\n                                     ', '', 13101, 'Oficina (2) 2 768 4049  Mónica Alarcó +569 9 330 4742 /José Acuña +569 6 908 5796', 'contacto@monicaeventos.com', 37815, '20161017141045Clases de Cocina Interactivas.jpg', '1', NULL),
(128, 78, 5, 'Tour Astronomico', '<p style="background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; border: 0px; margin-bottom: 0px; padding: 0px; vertical-align: baseline; outline: 0px; color: rgb(133, 133, 133); font-family: Raleway, sans-serif; font-size: 14px; line-height: 25px;">Interesante apuesta de turismo en una hermosa región de Chile, caminatas en el río Copiapoó, paseos a las dunas y entretenidas actividades. Ven a conocernos y a disfrutar de la naturaleza y cultura del norte del país.</p><p style="background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; border: 0px; margin-bottom: 0px; padding: 0px; vertical-align: baseline; outline: 0px; color: rgb(133, 133, 133); font-family: Raleway, sans-serif; font-size: 14px; line-height: 25px;">¿ Qué Incluye ?</p><ul style="background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; border: 0px; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; vertical-align: baseline; outline: 0px; list-style-position: inside; color: rgb(133, 133, 133); font-family: Montserrat, sans-serif; font-size: 14px;"><li style="background: 0px 0px; border: 0px; margin: 0px; padding: 0px; vertical-align: baseline; outline: 0px;">Tour astronómico – Cielos de Atacama</li><li style="background: 0px 0px; border: 0px; margin: 0px; padding: 0px; vertical-align: baseline; outline: 0px;">Para 2 personas</li><li style="background: 0px 0px; border: 0px; margin: 0px; padding: 0px; vertical-align: baseline; outline: 0px;">Salida a las 18:30 horas (Desde Copiapó)</li><li style="background: 0px 0px; border: 0px; margin: 0px; padding: 0px; vertical-align: baseline; outline: 0px;">Traslado hacia Inca de Oro</li><li style="background: 0px 0px; border: 0px; margin: 0px; padding: 0px; vertical-align: baseline; outline: 0px;">Visitas al Camino del Inca</li><li style="background: 0px 0px; border: 0px; margin: 0px; padding: 0px; vertical-align: baseline; outline: 0px;">Visita a Museo de Inca de Oro</li><li style="background: 0px 0px; border: 0px; margin: 0px; padding: 0px; vertical-align: baseline; outline: 0px;">Charla educativa astronómica básica</li><li style="background: 0px 0px; border: 0px; margin: 0px; padding: 0px; vertical-align: baseline; outline: 0px;">Observación en telescopios manuales y digital</li><li style="background: 0px 0px; border: 0px; margin: 0px; padding: 0px; vertical-align: baseline; outline: 0px;">Regreso a Copiapó alrededor de las 23:30 hrs</li><li style="background: 0px 0px; border: 0px; margin: 0px; padding: 0px; vertical-align: baseline; outline: 0px;">Traslados, merienda, guía turístico, admisión museo y observación astronómica.</li></ul><p style="background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; border: 0px; margin-bottom: 0px; padding: 0px; vertical-align: baseline; outline: 0px; color: rgb(133, 133, 133); font-family: Raleway, sans-serif; font-size: 14px; line-height: 25px;"><em style="background: 0px 0px; border: 0px; margin: 0px; padding: 0px; vertical-align: baseline; outline: 0px;">(Restricción: Merienda consiste en galletas y jugo. – Observación astronómica tiene una duración aproximadamente de 2 horas. – Llevar ropa abrigada para la noche, cámara fotográfica y ganas de compartir y disfrutar.- Sujeto a disponibilidad al reservar. – Sujeto a condiciones climáticas. – Traslados aeropuerto ni seguro de asistencia en viaje)</em></p>                                     \r\n                                     ', 'Carlos Pizarro Figueroa, Copiapó III Región Atacama.', 3101, '56 9  81909019', '', 35294, '20161018100034Chillitrip.jpg', '1', NULL),
