(138, 61, 5, 'Trekking y Yoga Outdoor', '<p style="margin: 0cm 0cm 0.0001pt; line-height: 19.5pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline;"><span style="font-size:10.5pt;font-family:"Arial",sans-serif;\r\ncolor:#818181">Nuestro objetivo en Samadhi es que el viajero logre una real\r\nconexión con su entorno. Que la experiencia en nuestras excursiones no se\r\nlimite al simple recuerdo estático de una fotografía, sino que se\r\nconvierta en una experiencia trascendental donde se logre sintonizar con\r\nla majestuosidad de la naturaleza.<o:p></o:p></span></p>\r\n\r\n<p style="margin: 0cm 0cm 0.0001pt; line-height: 19.5pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline;"><span style="font-size:10.5pt;font-family:"Arial",sans-serif;\r\ncolor:#818181"><o:p> </o:p></span></p>\r\n\r\n<p style="margin: 0cm 0cm 0.0001pt; line-height: 19.5pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline;"><span style="font-size:10.5pt;font-family:"Arial",sans-serif;\r\ncolor:#818181">¿ Qué Incluye ?<o:p></o:p></span></p>\r\n\r\n<p style="margin: 0cm 0cm 0.0001pt; line-height: 19.5pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline;"><span style="font-size:10.5pt;font-family:"Arial",sans-serif;\r\ncolor:#818181">· Full Day a locaciones exclusivas cercanas a Santiago,\r\ncomo Cajón del Maipo, Farellon