d-clip: initial; vertical-align: baseline;"><span style="font-size:10.5pt;font-family:"Arial",sans-serif;\r\ncolor:#818181">· Para 1 persona<br>\r\n· Actividad de montaña<o:p></o:p></span></p><p style="margin: 0cm 0cm 0.0001pt; line-height: 19.5pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline;"><span style="font-size:10.5pt;font-family:"Arial",sans-serif;\r\ncolor:#818181">· Descenso en roca con cuerdas<o:p></o:p></span></p><p style="margin: 0cm 0cm 0.0001pt; line-height: 19.5pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline;">\r\n\r\n\r\n\r\n</p><p style="margin: 0cm 0cm 0.0001pt; line-height: 19.5pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline;"><span style="font-size:10.5pt;font-family:"Arial",sans-serif;\r\ncolor:#818181"><br>\r\n<em><span style="border: 1pt none windowtext; padding: 0cm;">(Restricción: Condición física\r\nacorde a la actividad. No apto para menores de 12 años, ni embarazadas. Se\r\nsuspende la actividad en caso de lluvias. Se debe reservar vía correo o\r\ntelefónicamente donde se coordinará punto de encuentro.)</span></em><o:p></o:p></span></p>                                     \r\n                                     ', 'Valdivia – Región de los Ríos.', 14101, '+569 7 157 7617', 'contacto@valdiviaoutdoor.cl', 35294, '20161019075241Alpinismo-779060_800.jpeg', '1', NULL),
(144, 91, 5, 'Mi Vino', '<p style="margin: 0cm 0cm 0.0001pt; line-height: 19.5pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline;"><span style="font-size:10.5pt;font-family:"Arial",sans-serif;\r\ncolor:#818181">¿Has tenido alguna vez la oportunidad de hacer tu propio vino?<br>\r\nDe Martino te invita a convertirte en enólogo por un día y poner en\r\npráctica todo el proceso de vinificación. Vive esta experiencia única\r\njunto a un ser querido y llévate tu propio vino para compartir con quien\r\ntú quieras.<o:p></o:p></span></p>\r\n\r\n<p style="margin: 0cm 0cm 0.0001pt; line-height: 19.5pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline;"><span style="font-size:10.5pt;font-family:"Arial",sans-serif;\r\ncolor:#818181"><o:p> </o:p></span></p>\r\n\r\n<p style="margin: 0cm 0cm 0.0001pt; line-height: 19.5pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline;"><b><span style="font-size:10.5pt;font-family:"Arial",sans-serif;color:#818181">¿ Qué\r\nIncluye ?<o:p></o:p></span></b></p>\r\n\r\n<p style="margin: 0cm 0cm 0.0001pt; line-height: 19.5pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline;"><span style="font-size:10.5pt;font-family:"Arial",sans-serif;\r\ncolor:#818181">· Crear tu propio vino.<br>\r\n· Partiremos con un poco de historia de la viña, para luego recorrer los\r\nviñedos.<br>\r\n· En las bodegas de producción te entregaremos los materiales y tendrás una\r\nbreve charla enológica.<br>\r\n· Llevaremos a cabo el proceso de degustación y ensamblaje de tu vino.<o:p></o:p></span></p>\r\n\r\n<p style="margin: 0cm 0cm 0.0001pt; line-height: 19.5pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline;"><span style="font-size:10.5pt;font-family:"Arial",sans-serif;\r\ncolor:#818181"><br>\r\n<em><span style="border: 1pt none windowtext; padding: 0cm;">(Restricción: A\r\ncontinuación vendrá el proceso de embotellado, encorchado y etiquetado\r\n(personalizado) de tu propio vino. Reservar con 72 horas de anticipación. Sujeto\r\na disponibilidad.)</span></em><o:p></o:p></span></p>                                     \r\n                                     ', 'Manuel Rodríguez #229. Isla de Maipo ', 13603, '(2) 2 577 8837', 'visitas@demartino.cl', 40336, '20161019075536foto_0000000220121120175655 (1).jpg', '1', NULL),
(145, 92, 5, 'Aventura Aerea y Terrestre', '<p style="margin: 0cm 0cm 0.0001pt; line-height: 19.5pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline;"><span style="font-size:10.5pt;font-family:"Arial",sans-serif;\r\ncolor:#818181">Dedicados al placer de la aventura aérea. Disfruta como las aves\r\ncon nuestra experiencia; cuya misión es crear conciencia del vuelo libre.\r\nVive la sensación de volar junto a profesionales del más alto nivel. Aprovecha\r\nla oportunidad de vivir una tremenda experiencia y ver Santiago desde los\r\naires.<o:p></o:p></span></p>\r\n\r\n<p style="margin: 0cm 0cm 0.0001pt; line-height: 19.5pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline;"><span style="font-size:10.5pt;font-family:"Arial",sans-serif;\r\ncolor:#818181"><o:p> </o:p></span></p>\r\n\r\n<p style="margin: 0cm 0cm 0.0001pt; line-height: 19.5pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline;"><strong><span style="font-size:10.5pt;font-family:\r\n"Arial",sans-serif;color:#818181;border:none windowtext 1.0pt;mso-border-alt:\r\nnone windowtext 0cm;padding:0cm">¿ Qué Incluye ?</span></strong><span style="font-size:10.5pt;font-family:"Arial",sans-serif;color:#818181"><br>\r\n· Ascenso y descenso del Cerro el Carmen a caballo.<br>\r\n· Vuelo Biplaza con instructor personalizado (mínimo 15 minutos de vuelo), donde\r\nse podrá apreciar Santiago desde los aires.<br>\r\n· Fotos y Video de la actividad.<br>\r\n<!--[if !supportLineBreakNewLine]--><br>\r\n<!--[endif]--><em><span style="border: 1pt none windowtext; padding: 0cm;"><o:p></o:p></span></em></span></p>\r\n\r\n<p style="margin: 0cm 0cm 0.0001pt; line-height: 19.5pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline;"><em><span style="font-size:10.5pt;font-family:"Arial",sans-serif;\r\ncolor:#818181;border:none windowtext 1.0pt;mso-border-alt:none windowtext 0cm;\r\npadding:0cm">(Restricción: Sujeto a condiciones climáticas y a\r\ndisponibilidad. Reservar con 48 horas de anticipación. Menores de edad deben ir\r\nacompañados por sus padres.)</span></em><span style="font-size:10.5pt;\r\nfont-family:"Arial",sans-serif;color:#818181"><o:p></o:p></span></p>\r\n\r\n<p style="margin: 0cm 0cm 0.0001pt; line-height: 19.5pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline;"><span style="font-size:10.5pt;font-family:"Arial",sans-serif;\r\ncolor:#818181"> <o:p></o:p></span></p>                                     \r\n                                     ', 'Pedro de Fontova, (Cerro el Carmen) Huechuraba', 13301, '+569 9 280 1614', 'info@vueloenparapente.cl', 35294, '20161019075939G0020103.JPG', '1', NULL);
