(146, 93, 5, '¡ DISEÑA TU VESTIDO IDEAL !', '                                     <p style="margin: 0cm 0cm 0.0001pt; line-height: 19.5pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline;"><strong><span style="font-size:10.5pt;font-family:\r\n" arial",sans-serif;color:#818181;border:none="" windowtext="" 1.0pt;mso-border-alt:="" none="" 0cm;padding:0cm"="">¿ Qué Incluye ?</span></strong><span style="font-size:10.5pt;font-family:" arial",sans-serif;color:#818181"=""><o:p></o:p></span></p>\r\n\r\n<p class="MsoNormal" style="margin: 0cm 0cm 0.0001pt; text-indent: -18pt; line-height: 19.5pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline;"><!--[if !supportLists]--><span style="font-size:\r\n10.0pt;mso-bidi-font-size:10.5pt;font-family:Symbol;mso-fareast-font-family:\r\nSymbol;mso-bidi-font-family:Symbol;color:#818181">·<span style="font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: " times="" new="" roman";"="">        \r\n</span></span><!--[endif]--><span style="font-size:10.5pt;font-family:" arial",sans-serif;="" color:#818181"="">Crear un vestido único, en tu estilo, para tu tipo de cuerpo y\r\nocasión para la que lo quieres.<o:p></o:p></span></p>\r\n\r\n<p class="MsoNormal" style="margin: 0cm 0cm 0.0001pt; text-indent: -18pt; line-height: 19.5pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline;"><!--[if !supportLists]--><span style="font-size:\r\n10.0pt;mso-bidi-font-size:10.5pt;font-family:Symbol;mso-f