(147, 94, 5, 'Paseo a Caballo para dos', '<p style="margin: 0cm 0cm 0.0001pt; line-height: 19.5pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline;"><span style="font-size:10.5pt;font-family:"Arial",sans-serif;\r\ncolor:#818181">“Sal del estrés de la ciudad sin salir de Santiago y vuelve a\r\ndisfrutar de tu tiempo”. Somos una agencia que reúne gran variedad de\r\npanoramas y actividades, orientados a empresas y personas que deseen\r\ndisfrutar del tiempo libre o afiatar equipos de trabajo. Te invitamos a\r\ndisfrutar de actividades novedosas y a descubrir un nuevo Santiago.<o:p></o:p></span></p>\r\n\r\n<p style="margin: 0cm 0cm 0.0001pt; line-height: 19.5pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline;"><span style="font-size:10.5pt;font-family:"Arial",sans-serif;\r\ncolor:#818181"><o:p> </o:p></span></p>\r\n\r\n<p style="margin: 0cm 0cm 0.0001pt; line-height: 19.5pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline;"><span style="font-size:10.5pt;font-family:"Arial",sans-serif;\r\ncolor:#818181">¿ Qué Incluye ?<o:p></o:p></span></p>\r\n\r\n<p style="margin: 0cm 0cm 0.0001pt; line-height: 19.5pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline;"><span style="font-size:10.5pt;font-family:"Arial",sans-serif;\r\ncolor:#818181">· Una cabalgata para dos personas; una experiencia única que\r\ncombina la aventura<br>\r\nde cabalgar entre quebradas y bosques de Peumos y Quillay.<br>\r\n· Un rico picnic.<br>\r\n· Incluye: Caballo y guía.<br>\r\n<!--[if !supportLineBreakNewLine]--><br>\r\n<!--[endif]--><o:p></o:p></span></p>\r\n\r\n<p style="margin: 0cm 0cm 0.0001pt; line-height: 19.5pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline;"><i><span style="font-size:10.5pt;font-family:"Arial",sans-serif;color:#818181">(Restricción: Las\r\nreservas se deben realizar con 48 horas de antelación. La realización de\r\nla actividad está sujeta a disponibilidad. No incluye transporte.)<o:p></o:p></span></i></p>\r\n\r\n<p style="margin: 0cm 0cm 0.0001pt; line-height: 19.5pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline;"><i><span style="font-size:10.5pt;font-family:"Arial",sans-serif;color:#818181"> <o:p></o:p></span></i></p>                                     \r\n                                     ', 'Centro de Hipoterapia Tomás Muñoz, Av. La Dehesa 6500. Lo Barnechea', 13115, '+569 8 293 0845', 'info@lunada.cl', 42850, '20161019080714Paseo a Caballo para 2 Personas.jpg', '1', NULL),
(148, 95, 5, 'Vuelo en Parapente mas Fotos', '<p style="background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; border: 0px; margin-bottom: 0px; padding: 0px; vertical-align: baseline; outline: 0px; color: rgb(133, 133, 133); font-family: Raleway, sans-serif; font-size: 14px; line-height: 25px;">Vive una experiencia de vuelo libre por los despejados cielos de Antofagasta con TAM Xtreme, una escuela de vuelo reconocida por la Dirección General de Aeronáutica Civil que cuenta con instructores certificados. Disfruta de una vista privilegiada de la ciudad y graba en tu memoria este momento único.</p><p style="background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; border: 0px; margin-bottom: 0px; padding: 0px; vertical-align: baseline; outline: 0px; color: rgb(133, 133, 133); font-family: Raleway, sans-serif; font-size: 14px; line-height: 25px;"><strong style="background: 0px 0px; border: 0px; margin: 0px; padding: 0px; vertical-align: baseline; outline: 0px;">¿ Qué Incluye ?</strong></p><ul style="background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; border: 0px; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; vertical-align: baseline; outline: 0px; list-style-position: inside; color: rgb(133, 133, 133); font-family: Montserrat, sans-serif; font-size: 14px;"><li style="background: 0px 0px; border: 0px; margin: 0px; padding: 0px; vertical-align: baseline; outline: 0px;">Válido para una persona</li><li style="background: 0px 0px; border: 0px; margin: 0px; padding: 0px; vertical-align: baseline; outline: 0px;">Vuelo en parapente</li