INSERT INTO `productos` (`id`, `nombre`, `descripcion`, `precio`, `stock`, `foto`, `clase`, `subtitulo`, `color`, `descripcion_show`, `patrones`) VALUES
(1, 'Happy Day', '<div>Encontrarás alternativas para tener un momento entretenido y</div><div>agradable con originales actividades para disfrutar de un</div><div>increíble día, basadas en buenos momentos para una, dos o más</div><div>personas. Regala la posibilidad de elegir: Paseos en kayak, visitas</div><div>con la familia al zoológico, estilosos cortes de pelo, interesantes</div><div>degustaciones y mucho más.</div>                                                                          ', 14990, 603, '20160923103316Happy Day.jpg', 'happy', '¿TE GUSTARÍA PASAR UN DÍA AGRADABLE Y ORIGINAL LEJOS DE LA RUTINA?', 'e51483', 'Getaway Happy-Day reúne las más entretenidas y originales experiencias para pasar un día distinto, combinando diferentes tipos de actividades que te sorprenderán. Quien reciba esta caja de regalo podrá escoger desde agradables paseos en kayak, tarde o mañana en velero,zoológico en familia, hasta realizarse estilosos cortes de pelo en manos profesionales de excelentecia.', 'happyday02.jpg'),
(2, 'Bienestar', '                                     <div>Contiene las mejores alternativas para una persona, de las más</div><div>confortables y placenteras experiencias del mundo de la salud y</div><div>belleza. Regala la posibilidad de elegir entre: Relajantes e</div><div>innovadores masajes, efectivas terapias de belleza, variados</div><div>cortes de pelo y mucho más.</div><div><br></div><div><br></div>                                                                                                               ', 23990, 85, '20160923102949', 'bienestar', '¿ALGUNA VEZ TE HAS DADO UN TIEMPO PARA TÍ?', '11a9a7', 'Getaway Bienestar reúne las más confortables y placenteras experiencias del mundo de la salud y belleza. Quien reciba esta caja de regalo podrá escoger entre diferentes actiidades, como: relajantes e innovadores masajes, increíbles tratamientos de belleza y mucho más.', 'bienestar02.jpg'),
(3, 'Sabores', '<div>Selección de diferentes restaurantes gourmet, reconocidos por</div><div>su gran calidad gastronómica, donde podrá deleitar sus sentidos</div><div>junto a la persona que quiera, con increíbles servicios para dos</div><div>personas. Regala la posibilidad de elegir entre exquisitas</div><div>variedades de comida, como: mariscos, pizzas artesanales,</div><div>diferentes tipos de carnes, pescados, pastas y mucho más.</div>                                                                          ', 39990, 31, 'sabores-01.png', 'sabores', '¿ALGUNA VEZ, TE HAN DADO LA OPORTUNIDAD DE ELEGIR ENTRE DIFERENTES RESTAURANTES GOURMET?', 'b3c93d', 'Getaway Sabores reúne las mejores experiencias gastronómcas para dos personas, en restaurantes muy especiales. Quien reciba esta caja de regalo podrá escoger entre diferentes\nvariedades de la mejor comida, tales como: mariscos, pizzas, pastas, parrilladas y mucho más.', 'sbaores02.jpg'),
(4, 'Aventura', '                                                                          <div>Te invita a regalar deportes extremos, para que puedan disfrutar</div><div>de un increíble día repleto de adrenalina, con buenos momentos</div><div>para una, dos o más personas. Regala la posibilidad de elegir:</div><div>Increíbles vuelos en parapente, emocionantes descensos en</div><div>rafting, entretenidas clases de surf, fascinantes programas de</div><div>buceo, agradables cabalgatas y mucho más.</div>                                                                                                                                                    ', 39990, 82, '20160923102003Aventura.jpg', 'aventura', '¿HAS VIVIDO ALGUNA VEZ UNA EXPERIENCIA DE AVENTURA TOTAL?', '752e88', 'Getaway Aventura reúne las mas adrenalínicas y excitantes experiencias del deporte aventura. Quien reciba esta caja de regalo podrá escoger entre diferentes\nactividades, tales como: surf en hermosas playas, buceo en aguas del Océano Pacífico, rafting en diferentes lugares del país y mucho más.', 'aventura02.jpg'),
(5, 'Experiencias Únicas', '                                     <div>Nuestro equipo ha seleccionado las mejores alternativas de</div><div>nuestros diferentes productos, combinando interesantes</div><div>servicios y actividades, con opciones de buenos momentos para</div><div>una, dos o más personas. Regala la posibilidad de elegir:</div><div>Exquisitas degustaciones, increíbles actividades al aire libre,</div><div>interactivas clases de cocina y mucho más.</div>                                                                                                               ', 59990, 244, '20160923103125', 'exp', '¿TE GUSTARÍA VIVIR UNA EXPERIENCIA INIGUALABLE?', 'eb5c42', 'Getaway Experiencias Únicas, reúne las más atractivas alternativas que se pueden realizar en el día, combinando actividades relacionadas\ncon degustaciones, llamativos paisajes, espectaculares aventuras outdoor y lugares de relajo total entre otras cosas. Quien reciba esta caja de regalo\npodrá escoger, entre entretenidas actividades al aire libre, interesantes tours de relajo, interactivas clases de cocina, exquisitas degustaciones\ny mucho más.', 'experiencias02.jpg'),
(6, 'Noche Boutique', '<div>Se basa en una noche para dos personas, en confortables y</div><div>acogedores Hoteles Boutique, destacando su calidad y</div><div>excelente servicio. Regala la posibilidad de elegir entre</div><div>diferentes opciones de hoteles de esta categoría, situados en</div><div>increíbles lugares de nuestro país.</div>                                                                          ', 109990, 425, 'boutique-01.png', 'noche', '¿HAS PASADO UNA NOCHE EN UN LUGAR MÁGICO Y ENCANTADOR?', '1f8bcc', 'Getaway Noche Boutique, te invita a disfrutar de una increíble noche en diferentes Hoteles Boutique, destacando su calidad y excelente servicio.\nSe han seleccionado las mejores opciones, confortables y acogedoras, en esta categoría. Quien reciba esta caja de regalo podrá escoger entre diferentes\nestadías, en maravillosos lugares.', 'boutique02.jpg'),
(7, 'Para Dos', 'Producto 1', 8989, 5, '20170404043309ban_hammer.jpg', '', '', NULL, NULL, NULL),
(8, 'Extremos', '                                     \r\n                                     ', 231, 123, '2017040404405817362382_683101828536334_7623283991609250940_n.png', '', '', NULL, NULL, NULL);
